import React from 'react'
import { Comment } from '../comment'

interface CommentListProps{
    comments:Comment[];
    setComments:(comments:Comment[])=>void;
}

export const CommentList: React.FC<CommentListProps> = ({
    comments, 
    setComments
})=>{
    return <div>
       {comments.map()}
    </div>;
}
